import './App.css';

import { Homepage ,Predictresults,LoginPage, About,Error} from './containers';
import {BrowserRouter , Routes , Route} from 'react-router-dom';  
import Home from './containers/Home';
import {Navbar} from './conponents';
function App() {
  return (
    <BrowserRouter>
      <Routes>  

        {/* <Route path='/' element={<Navbar/>}> */}
        <Navbar/>
          <Route index element={<div className='/landing-page'><Home /></div>}></Route>
          <Route path='/predictResults' element={<Predictresults/>}></Route>
          <Route path='/login' element={<LoginPage/>}></Route>
          <Route path='/about' element={<About/>}></Route>
          {/* </Route> */}
          <Route path='*' element={<Error/>}></Route> 
      </Routes>
    </BrowserRouter>
  );
}

export default App;
